import React, { Component } from 'react';
import sax from './sax.png';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <h4>
            The Music Theory App
          </h4>
          <img src={sax} className="Sax"/>
        </header>
        <body>
          <h1>
            C
          </h1>
        </body>
      </div>
    );
  }
}

export default App;
